import React from "react";

const Logo = props => {
  return (
    <div>
      <p className="text-light">{props.what}</p>
      <h4 className="text-uppercase text-center display-5 fw-bolder">
        MOUNTAIN <br />
        <span className="p-5">biking</span>
      </h4>
    </div>
  );
};

export default Logo;
